import React from 'react';
import { Router, Route, Switch } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css';
import Ident from '../Identification/Identification'


function App() {
  return (
    <Router history="">
      <Switch>
      <Route path="/">
      Nic
      </Route>
      <Route path="/test">
      Test
      </Route>
      </Switch>
    </Router>
  );
}

export default App;
